import "./App.css";
import { BrowserRouter as Router,Switch,Route} from "react-router-dom";
import Home from "./pages/Home"
import Search from "./pages/search"
import MainMovies2 from "./pages/MainMovies2";
import Bollywood from "./components/Bollywood";
import Mvideo from "./components/Mvideo";
const App = () => {
  return ( 
    <>
    <div className="wrapper">
    <Router>
      <Switch>
    <Route path={`/video/:id`} component={Mvideo} exact/>
<Route path="/" component={Home} exact/>
<Route path="/movies" component={MainMovies2} exact/>
<Route path="/search" component={Search} exact />
<Route path="/bollywood" component={Bollywood} exact />

    </Switch>
    </Router>
    </div>
    </>
   );
}

export default App;
